import React, { useState } from 'react';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Box from '@mui/material/Box';
import './EverythingView.css';

const EverythingView = () => {
  const [tabValue, setTabValue] = useState(0);

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  return (
    <div className="everything-page">
      <h2>Everything</h2>
      <div className="task-board">
        <Box sx={{ maxWidth: { xs: 320, sm: 480 }, bgcolor: 'background.paper' }}>
          <Tabs
            value={tabValue}
            onChange={handleTabChange}
            variant="scrollable"
            scrollButtons="auto"
            aria-label="scrollable auto tabs example"
          >
            <Tab label="Tab One" />
            <Tab label="Tab Two" />
            <Tab label="Tab Three" />
            <Tab label="Tab Four" />
            <Tab label="Tab Five" />
          </Tabs>
        </Box>
        <div className="tab-content">
          {tabValue === 0 && <div>Tab One Content - Buraya tablo ekleyebilirsin</div>}
          {tabValue === 1 && <div>Tab Two Content</div>}
          {tabValue === 2 && <div>Tab Three Content</div>}
          {tabValue === 3 && <div>Tab Four Content</div>}
          {tabValue === 4 && <div>Tab Five Content</div>}
        </div>
      </div>
    </div>
  );
};

export default EverythingView;
